import React from 'react'

const FooterComponent = () => {
  return (
    <div>
        <footer class="text-center">
            <p>© 2022 ASpace, Inc.  <a class="footer-hyp" href="#">Privacy</a> · <a class="footer-hyp" href="#">Terms</a> · <a class="footer-hyp" href="#">Help</a></p>
        </footer>
    </div>
  )
}

export default FooterComponent
